import React from 'react'

const Render = () => {

    return (
        <div className='bg-green-500 flex flex-col justify-center h-screen p-8'>
            <div className='rounded-3xl p-8 bg-white imgrocket'>
                <img src={require('../components/media/rocket.png').default} alt='meme' className='w-full object-cover'/>
            </div>
        </div>
    )
}

export default Render
